/* Theme: oceanBlue */
@theme reference {
  --color-oceanBlue-background: 0 0% 100%;
  --color-oceanBlue-foreground: 0 0% 3.9%;
  --color-oceanBlue-card: 0 0% 100%;
  --color-oceanBlue-card-foreground: 0 0% 3.9%;
  --color-oceanBlue-popover: 0 0% 100%;
  --color-oceanBlue-popover-foreground: 0 0% 3.9%;
  --color-oceanBlue-primary: 199 89% 48%;
  --color-oceanBlue-primary-foreground: 0 0% 98%;
  --color-oceanBlue-secondary: 204 100% 97%;
  --color-oceanBlue-secondary-foreground: 0 0% 9%;
  --color-oceanBlue-muted: 210 40% 96%;
  --color-oceanBlue-muted-foreground: 0 0% 45.1%;
  --color-oceanBlue-accent: 201 94% 86%;
  --color-oceanBlue-accent-foreground: 0 0% 9%;
  --color-oceanBlue-destructive: 0 72% 51%;
  --color-oceanBlue-destructive-foreground: 0 0% 100%;
  --color-oceanBlue-border: 214 32% 91%;
  --color-oceanBlue-input: 214 32% 91%;
  --color-oceanBlue-ring: 199 89% 48%;
}

.theme-oceanBlue {
  --color-background: var(--color-oceanBlue-background);
  --color-foreground: var(--color-oceanBlue-foreground);
  --color-card: var(--color-oceanBlue-card);
  --color-card-foreground: var(--color-oceanBlue-card-foreground);
  --color-popover: var(--color-oceanBlue-popover);
  --color-popover-foreground: var(--color-oceanBlue-popover-foreground);
  --color-primary: var(--color-oceanBlue-primary);
  --color-primary-foreground: var(--color-oceanBlue-primary-foreground);
  --color-secondary: var(--color-oceanBlue-secondary);
  --color-secondary-foreground: var(--color-oceanBlue-secondary-foreground);
  --color-muted: var(--color-oceanBlue-muted);
  --color-muted-foreground: var(--color-oceanBlue-muted-foreground);
  --color-accent: var(--color-oceanBlue-accent);
  --color-accent-foreground: var(--color-oceanBlue-accent-foreground);
  --color-destructive: var(--color-oceanBlue-destructive);
  --color-destructive-foreground: var(--color-oceanBlue-destructive-foreground);
  --color-border: var(--color-oceanBlue-border);
  --color-input: var(--color-oceanBlue-input);
  --color-ring: var(--color-oceanBlue-ring);
}

@media (prefers-color-scheme: dark) {
  .theme-oceanBlue {
    --color-background: 240 10% 3.9%;
    --color-foreground: 0 0% 98%;
    --color-card: 240 10% 3.9%;
    --color-card-foreground: 0 0% 98%;
    --color-popover: 240 10% 3.9%;
    --color-popover-foreground: 0 0% 98%;
    --color-primary: 199 89% 88%;
    --color-primary-foreground: 240 5.9% 10%;
    --color-secondary: 240 3.7% 15.9%;
    --color-secondary-foreground: 0 0% 98%;
    --color-muted: 240 3.7% 15.9%;
    --color-muted-foreground: 240 5% 64.9%;
    --color-accent: 201 94% 26%;
    --color-accent-foreground: 0 0% 98%;
    --color-destructive: 0 62.8% 30.6%;
    --color-destructive-foreground: 0 0% 98%;
    --color-border: 240 3.7% 15.9%;
    --color-input: 240 3.7% 15.9%;
    --color-ring: 199 89% 88%;
  }
}

